import { Button } from '@material-ui/core';
import React, { useState, useEffect } from 'react';
import { UserLogin } from '../User/UserLogin';


export const UserUnknown = () => {

    const [register, setRegister] = useState(true);
    const [login, setLogin] = useState(false);

    const userHandler = () => {
        setLogin(!login) && setRegister(!register)
    }





    return (
        <>
            <div className="user">
                <div className="userLogin">
                    <div className="loginDetails">
                        <span className="loginTitle">Bienvenido,
                            carnavalero</span>
                    </div>
                    <>
                        {!login && (<div className="loginSubtitle"><span>See all the new features we’ve added through our tutorial.</span>
                            <span>See all the new features we’ve added through our tutorial.</span></div>)}

                    </>
                    <>
                        {register != true && (<form className="loginForm">
                            <div className="loginInfo"><label>Username</label>
                                <input type="text" /></div>
                            <div className="loginInfo"><label>Email</label>
                                <input type="mail" /></div>
                            <div className="loginInfo"><label>Password</label>
                                <input type="password" /></div>
                            <submit><Button onClick={userHandler} variant="contained" color="primary">Registrarse</Button></submit>

                        </form>)}
                        {login != true && (<form className="loginForm">
                            <div className="loginInfo"><label>Email</label>
                                <input type="mail" /></div>
                            <div className="loginInfo"><label>Password</label>
                                <input type="password" /></div>
                            <submit><Button onClick={userHandler} variant="contained" color="primary">Registrarse</Button></submit>

                        </form>)}

                    </>


                    <div className="loginButtons">

                        {!login && <Button onClick={userHandler} variant="contained" color="primary">Registrarse</Button>}
                        {register === true && <Button onClick={userHandler} variant="contained" color="primary">Iniciar sesión</Button>}
                    </div>
                </div>
            </div>

        </>
    );
}
